INSERT INTO `smartlifeservice` (`ID`, `Name`, `Price`, `Image`, `Characteristics`, `Details`, `HowToUse`, `Class`, `FurtherDetails`) VALUES
(1, 'Decoder TIMvision', 79.9, , 'With TIMvision decoder you have more than 8,000 titles,including cartoons, movies, always on demand series and documentaries to create your own schedule without commercial interruptions.<br>\n<br>\nUsing the remote control you can pause your favorite movie and restart it when you decide, you can review a scene or move on.', 'Dimensions (WxDxH)=> 210 mm x 210 mm x 40 mm<br><br>\n \nConfection => Decoder - Power cable - HDMI cable - Universal remote control - Batteries - Quick<br><br> 	\n\nInstallation Guide<br><br>\n \nProcessor => Intel ATOM Processor CE 4230<br><br>\n \nStorage => Ram 1 GByte DDR3<br><br>\n \nVideo mode PAL => 576p - 720p - 1080i - 1080p<br><br>', 'Connect the decoder to your ADSL Unlimited or TIM Fiber Optics to access:<br>\r\n \r\nTo Videostore of TIMvision, where you''ll find all the episodes of the best series, from the most famous to the most exclusive, cartoons and favorite series for children and teens, the most anticipated and many never seen movie premieres on TV or revise language original. Choose from over 6,000 titles to date.<br>\r\nthe Replay TV TIMvision, where you can find all television programs aired in the last seven days on RAI networks (all devices except streaming from web) and LA7 and the archive LA7<br>\r\nYouTube, to see the videos you want directly from your TV<br>\r\nYou can also enjoy the vision of Smart TV, on timvision.it and TIMvision app for Smartphone, Tablet and PC, using the credentials choices when registering to TIMvision service.', 'TV-ENTERTEIMENT', 'Cartoons, movies, TV series, documentaries and concerts always on demand to create your own schedule without advertising. More than 8,000 titles on a subscription, with no time constraints, even in HD');
